import React from "react";
import classes from './StartingPage.module.css';

const StartingPage = () => {
  return (
    <section className={classes.starting}>
      <h1 className={classes.h1}>Welcome to your EXPENCE-TRACKER</h1>
    </section>
  );
};

export default StartingPage;
